import React from 'react';
import PropTypes from 'prop-types';
import Box from '@mui/material/Box';
import Link from '@mui/material/Link';
import Typography from '@mui/material/Typography';
import Container from 'common/Container';

const Introduction = ({ themeMode = 'light' }) => {
  return (
    <Box>
      <Container>
        <Box>
          <Typography
            sx={{
              textTransform: 'uppercase',
              fontWeight: 'medium',
            }}
            gutterBottom
            align={'center'}
            color={'textSecondary'}
          >
            Introduction
          </Typography>
          <Typography
            variant="h4"
            align={'center'}
            sx={{
              fontWeight: 700,
            }}
          >
            Webbee - multipurpose template and UI kit
          </Typography>
          <Box
            component={'img'}
            height={'100%'}
            width={'100%'}
            src={`https://assets.maccarianagency.com/screenshots/screens-masonry${
              themeMode === 'dark' ? '--dark' : ''
            }.png`}
            alt="Webbee"
            effect="blur"
            maxWidth={'100%'}
            marginY={4}
            loading="lazy"
          />
          <Box>
            <Typography gutterBottom>
              Webbe UI Kit is built with{' '}
              <Link
                underline={'hover'}
                href={'https://mui.com/'}
                target={'_blank'}
              >
                MUI v5
              </Link>{' '}
              and{' '}
              <Link
                underline={'hover'}
                href={'https://create-react-app.dev/'}
                target={'_blank'}
              >
                Create React App
              </Link>
            </Typography>
            <Typography gutterBottom>
              A professional React Kit that comes with plenty of ready-to-use
              Material-UI components that will help you to build more beautiful
              ontend pages.
            </Typography>
            <Typography gutterBottom>
              The theme is ready to change to any style you want.
            </Typography>
            <Typography gutterBottom>
              Webbee landing page examples can be used out of the box, but since
              theyâ€™re built on flexible components, you can also create new
              pages all your own with ease.
            </Typography>
            <Typography gutterBottom>
              Copy-paste a section here, a component there, switch up a few
              variables, and you have an entirely new landing!
            </Typography>
          </Box>
          <Box marginTop={4}>
            <Typography
              variant="h6"
              gutterBottom
              sx={{
                fontWeight: 700,
              }}
            >
              Feedback
            </Typography>
            <Typography gutterBottom>
              We are always open to your feedback at{' '}
              <Link
                component={'a'}
                href="mailto:hi@maccarianagency.com"
                color={'primary'}
              >
                hi@maccarianagency.com
              </Link>
            </Typography>
            <Typography>
              If something is missing in the documentation, or if you found some
              part confusing, contact us with your suggestions for improvement.
              We love hearing from you!
            </Typography>
          </Box>
        </Box>
      </Container>
    </Box>
  );
};

Introduction.propTypes = {
  themeMode: PropTypes.string.isRequired,
};

export default Introduction;
